const initialState = '';

export const setWinningSquares = () => ({
    type: 'SET_NAME',
});

const winningSquaresReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'SET_NAME':
            console.log('svsfd?');
            return '';
        default:
            return state;
    }
};

export default winningSquaresReducer;
